import React from 'react';

const Button = ({ text = "Click Me", onClick = ()=>console.log("Lol!") }) => {
  return (
    <div style={styles.container} onClick={onClick}>
      <a style={styles.button} className="button-animation">
        {text}
      </a>
    </div>
  );
};

const styles = {
  container: {
    display: 'inline-block',
    cursor: 'pointer',
  },
  button: {
    textDecoration: 'none',
    color: '#fff',
    padding: '10px 20px',
    borderRadius: '8px',
    backgroundColor: '#007BFF',
    fontWeight: 'bold',
    transition: 'all 0.3s ease',
    display: 'inline-block',
  },
};

// Example of animations (can be used in your CSS file or styled-components)
const animations = `
.button-animation {
  position: relative;
  overflow: hidden;
}

.button-animation::before {
  content: '';
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(255, 255, 255, 0.3);
  transform: scale(0);
  transition: transform 0.4s ease;
  z-index: 1;
}

.button-animation:hover::before {
  transform: scale(4);
  z-index: 0;
}

.button-animation:hover {
  background-color: #0056b3;
}

.button-animation:active {
  transform: translateY(2px);
  background-color: #004080;
}

.button-animation:focus {
  outline: 2px dashed #80bfff;
  outline-offset: 4px;
}
`;


export default Button;
